import React from "react";
import ReactDOM from "react-dom/client";
import "./index.css";
import App from "./App";
import "react-calendar/dist/Calendar.css";

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
    <React.StrictMode>
        <App />
        {/* Modal Root */}
        <div id="modal-root"></div>
    </React.StrictMode>
);
